/*Table structure for table `book` */

DROP TABLE IF EXISTS `book`;

CREATE TABLE `book` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `book_name` varchar(300) NOT NULL DEFAULT '' COMMENT '书籍名',
  `book_code` varchar(150) NOT NULL DEFAULT '' COMMENT '书籍编号',
  `category` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '书籍类别（1-计算机，2文学，3-建筑）',
  `is_del` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否已删除（1-是，0-否）',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '记录创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '记录更新时间',
  `create_user` int(11) NOT NULL DEFAULT '0' COMMENT '记录创建人',
  `update_user` int(11) NOT NULL DEFAULT '0' COMMENT '记录更新人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

